import React, { useState } from "react";
import Button from 'react-bootstrap/Button'

const ProfileView = () => {
  return (
    <div>
      <div>profile page</div>
      <h3>import profile info from form</h3>
      <div>
        <Button href="/workouts/saved" variant="primary" size="lg" active>
          Saved workouts
        </Button>
        <Button href="/workouts/add" variant="secondary" size="lg" active>
          Add new workouts
        </Button>
        <Button href="/profile/edit" variant="secondary" size="lg" active>
          Edit profile
        </Button>
      </div>
    </div>
  );
};

export default ProfileView;
